function goBack() {
  var prevRoute = Session.get('prevRoute');

  if (prevRoute) {
    FlowRouter.go(prevRoute.name, prevRoute.args);
    Session.set('prevRoute', false);

    if (prevRoute.scrollTo) {
      scrollTo(prevRoute.scrollTo, 0, 500);
    }
  } else {
    FlowRouter.go("/account/myproperies/", {
      pageno: 1
    });
  }
}

