  pricing.totalAllInclusive = parseFloat(pricing.totalAllInclusive);
  pricing.basicUnitCost.totalBasicRatepsft = ratePerSqFt + pricing.basicUnitCost.floorRaiseCharge + pricing.basicUnitCost.plcCharge;
